class DataGrid {
  constructor(x, y, w, h) {
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
  }
}

export class DataGridWithText extends DataGrid {
  constructor(text) {
    super().this.x = x;
    super().this.y = y;
    super().this.w = w;
    super().this.h = h;
    this.text = text;
  }
}

export class DataGridWithTextAndImage extends DataGrid {
  constructor(text, image, alt) {
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
    this.text = text;
    this.image = image;
    this.alt = alt;
  }
}

export class DataGridWithImage extends DataGrid {
  constructor(image, alt) {
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
    this.image = image;
    this.alt = alt;
  }
}

export class DataGridWithTextAndTitle extends DataGrid {
  constructor(text, title) {
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
    this.text = text;
    this.title = title;
  }
}

export class DataGridWithImageAndUrl extends DataGrid {
  constructor(url, image, alt) {
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
    this.url = url;
    this.image = image;
    this.alt = alt;
  }
}
